import React from 'react';

const Customer = (props) => {
    return(
        <div>
            <h2>{props.name}</h2>
            <p>{props.birthday}</p>
            <p>{props.gender}</p>
            <p>{props.job}</p>
        </div>
    )
}

const CustomerProfile = (props) => {
    return(
        <div>
            <h2>{props.name}({props.id})</h2>
        </div>
    )
}

const CustomerInfo = (props) => {
    return(
        <div>
            <p>{props.birthday}</p>
            <p>{props.gender}</p>
            <p>{props.job}</p>
        </div>
    )
}


export default Customer;
